import React, { useState, useEffect } from 'react';

export default function Projects(){

    useEffect(() => {
        fetch('/', {
            method: 'GET'
            })
            .then(response => response.json())
            .then(data => console.log(data))
    });

    return (
        <div>
            <br/>
            <h1>Projects</h1>
        </div>
    )
}
